import { BrowserRouter, Routes, Route } from 'react-router-dom';
impo

import Home from "./home";

const Router = () => {
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/details" element={<Details />} />
            </Routes>
        </BrowserRouter>
    )
}

export default Router;
